import React from 'react';

export default function CustomInput({props}){
    return (
        <div>
            <label>{props && props.labelName ? props.labelName : "" }</label>
            <input  
                style={{
                    display: "inline",
                    color: "black",
                    width: "35%",
                    height: "10px"
                }}
                type={props && props.type ? props.type : "text"}
            /> 
             
        </div>

    )
} ;
